def x(n):
    target = n*4+1
    r = math.isqrt(target)
    if r % 2 == 1 and r*r == target: return [n, 0, 0]
    K = (r-1)//2
    n1 = n - K*(K+1)
    for i in range(K,-1,-1):
        target1 = n1*4+1
        if target1 <= 0:
            print(n,i,n1,target1)
        r1 = math.isqrt(target1)
        if r1 % 2 == 1 and r1*r1 == target1:
            print("i", K-i)
            return [n-n1, n1, 0]
        for q,F in Fs:
            if n1%q in F:
                print("skipped")
                break
        else:
            k = (r1-1)//2
            n2 = n1 - k*(k+1)
            if n2 < 0:
                print(r1*r1 <= target1, r1*r1 <= n1*4+1, (r1*r1-1)//4 <= n1, k*(k+1) <= n1)
                print((r1-1)//2*(r1+1)//2 <= n1)
            for j in range(k,-1,-1):
                target2 = n2*4+1
                r2 = math.isqrt(target2)
                if r2 % 2 == 1 and r2*r2 == target2:
                    print("i", K-i, "j", k-j)
                    return [n-n1, n1-n2, n2]
                n2 += 2*j
        n1 += 2*i


