def x(n):
    r = math.sqrt(n*4+1)
    if r % 2 == 1: return [n, 0, 0]
    K = math.floor((r-1)/2)
    I = K*(K+1)
    for i in range(K,-1,-1):
#         I = i*(i+1)
        n1 = n - I
        r = math.sqrt(n1*4+1)
        if r % 2 == 1: return [I, n1, 0]
        for q,F in Fs:
            if n1%q in F:
                break
        k = math.floor((r-1)/2)
        J = k*(k+1)
        for j in range(k,-1,-1):
            n2 = n1 - J
            r = math.sqrt(n2*4+1)
            if r % 2 == 1: return [I, J, n2]
            J -= 2*j
        I -= 2*i

